INSERT INTO `email_templates` VALUES (1,'password_reset','Password Reset','<p>Dear {{user_name}},</p>\n                <p>Do you want to reset your password? Please Click the following link and Reset Your Password.</p>','2024-09-24 18:45:51','2024-09-24 18:45:51'),(2,'contact_mail','Contact Email','<p>Hello there,</p>\n                <p>&nbsp;Mr. {{name}} has sent a new message. you can see the message details below.&nbsp;</p>\n                <p>Email: {{email}}</p>\n                <p>Phone: {{phone}}</p>\n                <p>Subject: {{subject}}</p>\n                <p>Message: {{message}}</p>','2024-09-24 18:45:51','2024-09-24 18:45:51'),(3,'subscribe_notification','Subscribe Notification','<p>Hi there, Congratulations! Your Subscription has been created successfully. Please Click the following link and Verified Your Subscription. If you will not approve this link, you can not get any newsletter from us.</p>','2024-09-24 18:45:51','2024-09-24 18:45:51'),(4,'user_verification','User Verification','<p>Dear {{user_name}},</p>\n                <p>Congratulations! Your Account has been created successfully. Please Click the following link and Active your Account.</p>','2024-09-24 18:45:51','2024-09-24 18:45:51'),(5,'approved_refund','Refund Request Approval','<p>Dear {{user_name}},</p>\n                <p>We are happy to say that, we have send {{refund_amount}} USD to your provided bank information. </p>','2024-09-24 18:45:51','2024-09-24 18:45:51'),(6,'new_refund','New Refund Request','<p>Hello InnvaTech, </p>\n\n                <p>Mr. {{user_name}} has send a new refund request to you.</p>','2024-09-24 18:45:51','2024-09-24 18:45:51'),(7,'pending_wallet_payment','Wallet Payment Approval','<p>Hello {{user_name}},</p>\n                <p>We have received your wallet payment request. we find your payment to our bank account.</p>\n                <p>Thanks &amp; Regards</p>','2024-09-24 18:45:51','2024-09-24 18:45:51'),(8,'approved_withdraw','Withdraw Request Approval','<p>Dear {{user_name}},</p>\n                <p>We are happy to say that, we have send a withdraw amount to your provided bank information.</p>\n                <p>Thanks &amp; Regards</p>\n                <p>InnvaTech</p>','2024-09-24 18:45:51','2024-09-24 18:45:51');
