  `stock_alert` double DEFAULT '0',
  `is_imei` tinyint(1) NOT NULL DEFAULT '0',
  `not_selling` tinyint(1) NOT NULL DEFAULT '0',
  `stock` int NOT NULL DEFAULT '0',
  `stock_status` enum('in_stock','out_of_stock') COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'in_stock',
  `sku` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
